import React, {useEffect, useState} from "react";

import {apiDelete, apiGet} from "../utils/api";

const PersonsStatistics = () => {
    const [statistic, setStatistic] = useState({});

    useEffect(() => {
        apiGet("/api/persons/statistics").then((data) => setStatistic(data));
    });

    useEffect(() => {
        apiGet("/api/identification/" + identificationNumber + "/sales").then((data) => setIssuedInvoices(data))
    }, [identificationNumber]);

    return (
        <>
            <div>
                <h3>Statistiky pro jednotlivé společnosti</h3>
                <hr/>
                <table className="table table-bordered">
                <thead>
                <tr>
                    <th>ID</th>
                    <th>Jméno</th>
                    <th>Příjmy</th>
                </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{statistic.personId}</td>
                        <td>{statistic.personName}</td>
                        <td>{statistic.revenue}</td>
                    </tr>
                </tbody>
            </table>
            </div>
        </>
    );

};
export default PersonsStatistics;
